import lift from '../res/girl-lift.png'
import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

function App() {
  return (
   <div>
      <Parallax pages={4} ref={ref}>

        <ParallaxLayer
          offset={0}
          speed={1}
          factor={2}
          style={{
            backgroundColor: 'black',
            backgroundSize: 'cover',
          }}
        />

        <ParallaxLayer
          offset={2}
          speed={1}
          factor={4}
          style={{
            backgroundColor: 'black',
            backgroundSize: 'cover',
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          sticky={{ start: 0.9, end: 2.5 }}
          style={{ textAlign: 'center' }}
        >
          <img src={lift} />
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default App;
